import React from 'react';

function WelcomeSection() {
  return (
    <div className="welcome-section">
      <div className="welcome-text">
        <h1>Welcome to GoonMart, the best online store!</h1>
        <h2>Happy Shopping :)</h2>
      </div>
    </div>
  );
}

export default WelcomeSection;
